import React from 'react';
import './posts.css'
import {Link} from 'react-router-dom'
const Articles = (props) => {
    return(
        <div className="post">
            <Link className="author"><h3>{props.author}</h3></Link>
            <h4>{props.title}</h4>
            <h6>{props.content}</h6>
        </div>
    )
}
export default Articles;
